import React from 'react';
import './GamePage.css'; // Nous créerons ce fichier ensuite

const GamePage = () => {
  return (
    <div className="game-container">
      <div className="game-table"></div>
      
      <div className="game-board">
        <div className="holographic-effect"></div>
        
        <header className="game-header">
          <h1 className="game-title">CYBER@HACK</h1>
        </header>
        
        <div className="game-content">
          <div className="player-section">
            {/* Zone du joueur */}
          </div>
          
          <div className="center-section">
            {/* Zone des cartes secteur */}
          </div>
          
          <div className="opponent-section">
            {/* Zone adversaire (pour le mode multi) */}
          </div>
        </div>
      </div>
    </div>
  );
};

export default GamePage;
